+ (void)drawPacManWithFrame: (CGRect)frame
{
    //// Color Declarations
    UIColor* pacManColor = [UIColor colorWithRed: 1 green: 0.806 blue: 0 alpha: 1];

    //// Oval Drawing
    CGRect ovalRect = CGRectMake(CGRectGetMinX(frame), CGRectGetMinY(frame), CGRectGetWidth(frame), CGRectGetHeight(frame));
    UIBezierPath* ovalPath = UIBezierPath.bezierPath;
    [ovalPath addArcWithCenter: CGPointMake(CGRectGetMidX(ovalRect), CGRectGetMidY(ovalRect)) radius: CGRectGetWidth(ovalRect) / 2 startAngle: 24 * M_PI/180 endAngle: -24 * M_PI/180 clockwise: YES];
    [ovalPath addLineToPoint: CGPointMake(CGRectGetMidX(ovalRect), CGRectGetMidY(ovalRect))];
    [ovalPath closePath];

    [pacManColor setFill];
    [ovalPath fill];
}

