+ (void)drawFrontDoorWithFrame: (CGRect)frame
{
    //// General Declarations
    CGContextRef context = UIGraphicsGetCurrentContext();

    //// Color Declarations
    UIColor* translucentBlack = [UIColor colorWithRed: 0 green: 0 blue: 0 alpha: 0.5];
    UIColor* baseColor = [UIColor colorWithRed: 0.808 green: 0.638 blue: 0.425 alpha: 1];
    CGFloat baseColorRGBA[4];
    [baseColor getRed: &baseColorRGBA[0] green: &baseColorRGBA[1] blue: &baseColorRGBA[2] alpha: &baseColorRGBA[3]];

    UIColor* baseLightColor = [UIColor colorWithRed: (baseColorRGBA[0] * 0.5 + 0.5) green: (baseColorRGBA[1] * 0.5 + 0.5) blue: (baseColorRGBA[2] * 0.5 + 0.5) alpha: (baseColorRGBA[3] * 0.5 + 0.5)];
    UIColor* translucentBaseColor = [UIColor colorWithRed: (baseColorRGBA[0] * 0.5 + 0.5) green: (baseColorRGBA[1] * 0.5 + 0.5) blue: (baseColorRGBA[2] * 0.5 + 0.5) alpha: (baseColorRGBA[3] * 0.5 + 0.5)];
    CGFloat translucentBaseColorRGBA[4];
    [translucentBaseColor getRed: &translucentBaseColorRGBA[0] green: &translucentBaseColorRGBA[1] blue: &translucentBaseColorRGBA[2] alpha: &translucentBaseColorRGBA[3]];

    UIColor* bevelShadowColor2 = [UIColor colorWithRed: (translucentBaseColorRGBA[0] * 0.15 + 0.85) green: (translucentBaseColorRGBA[1] * 0.15 + 0.85) blue: (translucentBaseColorRGBA[2] * 0.15 + 0.85) alpha: (translucentBaseColorRGBA[3] * 0.15 + 0.85)];
    UIColor* baseLighterColor = [UIColor colorWithRed: (baseColorRGBA[0] * 0.2 + 0.8) green: (baseColorRGBA[1] * 0.2 + 0.8) blue: (baseColorRGBA[2] * 0.2 + 0.8) alpha: (baseColorRGBA[3] * 0.2 + 0.8)];
    UIColor* blackOpacity15 = [UIColor colorWithRed: 0 green: 0 blue: 0 alpha: 0.15];

    //// Shadow Declarations
    UIColor* bottomThinShadow = translucentBlack;
    CGSize bottomThinShadowOffset = CGSizeMake(0.1, 1.1);
    CGFloat bottomThinShadowBlurRadius = 2;
    UIColor* bottomShadow = translucentBlack;
    CGSize bottomShadowOffset = CGSizeMake(0.1, 2.1);
    CGFloat bottomShadowBlurRadius = 3;
    UIColor* whiteBottom = UIColor.whiteColor;
    CGSize whiteBottomOffset = CGSizeMake(0.1, 2.1);
    CGFloat whiteBottomBlurRadius = 0;
    UIColor* bevelShadow2 = bevelShadowColor2;
    CGSize bevelShadow2Offset = CGSizeMake(0.1, -2.1);
    CGFloat bevelShadow2BlurRadius = 2;
    UIColor* darkInner = blackOpacity15;
    CGSize darkInnerOffset = CGSizeMake(0.1, 1.1);
    CGFloat darkInnerBlurRadius = 1;


    //// Subframes
    CGRect frontDoorGroup = CGRectMake(CGRectGetMinX(frame) + 2, CGRectGetMinY(frame) + 2, CGRectGetWidth(frame) - 4, CGRectGetHeight(frame) - 4);


    //// Front Door Frame Group
    {
        //// Front Door Group
        {
            CGContextSaveGState(context);
            CGContextSetShadowWithColor(context, bottomShadowOffset, bottomShadowBlurRadius, [bottomShadow CGColor]);
            CGContextBeginTransparencyLayer(context, NULL);


            //// Door Step Drawing
            UIBezierPath* doorStepPath = [UIBezierPath bezierPathWithRect: CGRectMake(CGRectGetMinX(frontDoorGroup) + floor(CGRectGetWidth(frontDoorGroup) * 0.00000 + 0.5), CGRectGetMinY(frontDoorGroup) + floor(CGRectGetHeight(frontDoorGroup) * 0.95455 + 0.5), floor(CGRectGetWidth(frontDoorGroup) * 1.00000 + 0.5) - floor(CGRectGetWidth(frontDoorGroup) * 0.00000 + 0.5), floor(CGRectGetHeight(frontDoorGroup) * 1.00000 + 0.5) - floor(CGRectGetHeight(frontDoorGroup) * 0.95455 + 0.5))];
            [baseLighterColor setFill];
            [doorStepPath fill];


            //// Door Panel Drawing
            UIBezierPath* doorPanelPath = [UIBezierPath bezierPathWithRect: CGRectMake(CGRectGetMinX(frontDoorGroup) + floor(CGRectGetWidth(frontDoorGroup) * 0.07143 + 0.5), CGRectGetMinY(frontDoorGroup) + floor(CGRectGetHeight(frontDoorGroup) * 0.00000 + 0.5), floor(CGRectGetWidth(frontDoorGroup) * 0.92857 + 0.5) - floor(CGRectGetWidth(frontDoorGroup) * 0.07143 + 0.5), floor(CGRectGetHeight(frontDoorGroup) * 0.95455 + 0.5) - floor(CGRectGetHeight(frontDoorGroup) * 0.00000 + 0.5))];
            [baseLighterColor setFill];
            [doorPanelPath fill];

            ////// Door Panel Inner Shadow
            CGContextSaveGState(context);
            UIRectClip(doorPanelPath.bounds);
            CGContextSetShadowWithColor(context, CGSizeZero, 0, NULL);

            CGContextSetAlpha(context, CGColorGetAlpha([bevelShadow2 CGColor]));
            CGContextBeginTransparencyLayer(context, NULL);
            {
                UIColor* opaqueShadow = [bevelShadow2 colorWithAlphaComponent: 1];
                CGContextSetShadowWithColor(context, bevelShadow2Offset, bevelShadow2BlurRadius, [opaqueShadow CGColor]);
                CGContextSetBlendMode(context, kCGBlendModeSourceOut);
                CGContextBeginTransparencyLayer(context, NULL);

                [opaqueShadow setFill];
                [doorPanelPath fill];

                CGContextEndTransparencyLayer(context);
            }
            CGContextEndTransparencyLayer(context);
            CGContextRestoreGState(context);



            //// Door Top Panel Drawing
            UIBezierPath* doorTopPanelPath = [UIBezierPath bezierPathWithRect: CGRectMake(CGRectGetMinX(frontDoorGroup) + floor(CGRectGetWidth(frontDoorGroup) * 0.25000 + 0.5), CGRectGetMinY(frontDoorGroup) + floor(CGRectGetHeight(frontDoorGroup) * 0.09091 + 0.5), floor(CGRectGetWidth(frontDoorGroup) * 0.78571 + 0.5) - floor(CGRectGetWidth(frontDoorGroup) * 0.25000 + 0.5), floor(CGRectGetHeight(frontDoorGroup) * 0.45455 + 0.5) - floor(CGRectGetHeight(frontDoorGroup) * 0.09091 + 0.5))];
            CGContextSaveGState(context);
            CGContextSetShadowWithColor(context, whiteBottomOffset, whiteBottomBlurRadius, [whiteBottom CGColor]);
            [baseLightColor setFill];
            [doorTopPanelPath fill];

            ////// Door Top Panel Inner Shadow
            CGContextSaveGState(context);
            UIRectClip(doorTopPanelPath.bounds);
            CGContextSetShadowWithColor(context, CGSizeZero, 0, NULL);

            CGContextSetAlpha(context, CGColorGetAlpha([darkInner CGColor]));
            CGContextBeginTransparencyLayer(context, NULL);
            {
                UIColor* opaqueShadow = [darkInner colorWithAlphaComponent: 1];
                CGContextSetShadowWithColor(context, darkInnerOffset, darkInnerBlurRadius, [opaqueShadow CGColor]);
                CGContextSetBlendMode(context, kCGBlendModeSourceOut);
                CGContextBeginTransparencyLayer(context, NULL);

                [opaqueShadow setFill];
                [doorTopPanelPath fill];

                CGContextEndTransparencyLayer(context);
            }
            CGContextEndTransparencyLayer(context);
            CGContextRestoreGState(context);

            CGContextRestoreGState(context);



            //// Door Bottom Panel Drawing
            UIBezierPath* doorBottomPanelPath = [UIBezierPath bezierPathWithRect: CGRectMake(CGRectGetMinX(frontDoorGroup) + floor(CGRectGetWidth(frontDoorGroup) * 0.25000 + 0.5), CGRectGetMinY(frontDoorGroup) + floor(CGRectGetHeight(frontDoorGroup) * 0.52273 + 0.5), floor(CGRectGetWidth(frontDoorGroup) * 0.78571 + 0.5) - floor(CGRectGetWidth(frontDoorGroup) * 0.25000 + 0.5), floor(CGRectGetHeight(frontDoorGroup) * 0.88636 + 0.5) - floor(CGRectGetHeight(frontDoorGroup) * 0.52273 + 0.5))];
            CGContextSaveGState(context);
            CGContextSetShadowWithColor(context, whiteBottomOffset, whiteBottomBlurRadius, [whiteBottom CGColor]);
            [baseLightColor setFill];
            [doorBottomPanelPath fill];

            ////// Door Bottom Panel Inner Shadow
            CGContextSaveGState(context);
            UIRectClip(doorBottomPanelPath.bounds);
            CGContextSetShadowWithColor(context, CGSizeZero, 0, NULL);

            CGContextSetAlpha(context, CGColorGetAlpha([darkInner CGColor]));
            CGContextBeginTransparencyLayer(context, NULL);
            {
                UIColor* opaqueShadow = [darkInner colorWithAlphaComponent: 1];
                CGContextSetShadowWithColor(context, darkInnerOffset, darkInnerBlurRadius, [opaqueShadow CGColor]);
                CGContextSetBlendMode(context, kCGBlendModeSourceOut);
                CGContextBeginTransparencyLayer(context, NULL);

                [opaqueShadow setFill];
                [doorBottomPanelPath fill];

                CGContextEndTransparencyLayer(context);
            }
            CGContextEndTransparencyLayer(context);
            CGContextRestoreGState(context);

            CGContextRestoreGState(context);



            //// Door Knob Drawing
            UIBezierPath* doorKnobPath = [UIBezierPath bezierPathWithOvalInRect: CGRectMake(CGRectGetMinX(frontDoorGroup) + floor(CGRectGetWidth(frontDoorGroup) * 0.10714 + 0.5), CGRectGetMinY(frontDoorGroup) + floor(CGRectGetHeight(frontDoorGroup) * 0.45455 + 0.5), floor(CGRectGetWidth(frontDoorGroup) * 0.21429 + 0.5) - floor(CGRectGetWidth(frontDoorGroup) * 0.10714 + 0.5), floor(CGRectGetHeight(frontDoorGroup) * 0.52273 + 0.5) - floor(CGRectGetHeight(frontDoorGroup) * 0.45455 + 0.5))];
            CGContextSaveGState(context);
            CGContextSetShadowWithColor(context, bottomThinShadowOffset, bottomThinShadowBlurRadius, [bottomThinShadow CGColor]);
            [UIColor.whiteColor setFill];
            [doorKnobPath fill];

            ////// Door Knob Inner Shadow
            CGContextSaveGState(context);
            UIRectClip(doorKnobPath.bounds);
            CGContextSetShadowWithColor(context, CGSizeZero, 0, NULL);

            CGContextSetAlpha(context, CGColorGetAlpha([bevelShadow2 CGColor]));
            CGContextBeginTransparencyLayer(context, NULL);
            {
                UIColor* opaqueShadow = [bevelShadow2 colorWithAlphaComponent: 1];
                CGContextSetShadowWithColor(context, bevelShadow2Offset, bevelShadow2BlurRadius, [opaqueShadow CGColor]);
                CGContextSetBlendMode(context, kCGBlendModeSourceOut);
                CGContextBeginTransparencyLayer(context, NULL);

                [opaqueShadow setFill];
                [doorKnobPath fill];

                CGContextEndTransparencyLayer(context);
            }
            CGContextEndTransparencyLayer(context);
            CGContextRestoreGState(context);

            CGContextRestoreGState(context);



            CGContextEndTransparencyLayer(context);
            CGContextRestoreGState(context);
        }
    }
}

